import React from 'react'
import {Container,Title} from './style'
const Trendeng = () => {
    return (
       <Container>
           <Title>TRENDING</Title>
           <Ul>
                 <Li>Top Products</Li>
                 
           </Ul>
       </Container>
    )
}

export default Trendeng
